export default (function(a,b,c,d,e,f,g){return {data:{"9EdY7FwJjp":{data:[{id:2745,attributes:{type:e,item_lang:{data:{id:3412,attributes:{title:"House of the Dragon",slug:"house-of-the-dragon"}}}}},{id:2747,attributes:{type:a,item_lang:{data:{id:3414,attributes:{title:"Bullet Train",slug:"bullet-train"}}}}},{id:2752,attributes:{type:a,item_lang:{data:{id:3419,attributes:{title:"White Noise",slug:"white-noise"}}}}},{id:2765,attributes:{type:a,item_lang:{data:{id:3432,attributes:{title:"Argylle",slug:"argylle"}}}}},{id:2772,attributes:{type:e,item_lang:{data:{id:3439,attributes:{title:"Super Pumped",slug:"super-pumped"}}}}}],meta:{pagination:{page:f,pageSize:25,pageCount:f,total:5}}},ZOa59MBR48:{data:{id:383,attributes:{imdbId:"tt0816442",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BOTE3NzkyMjAyNF5BMl5BanBnXkFtZTgwMDc5MTE0MDE@._V1_SX300.jpg",type:a,ratings:[{Source:"Internet Movie Database",Value:"7.5\u002F10"},{Source:"Rotten Tomatoes",Value:"48%"},{Source:"Metacritic",Value:"53\u002F100"}],item_lang:{data:{id:1046,attributes:{title:"The Book Thief",plot:"In 1938, the young girl Liesel Meminger is traveling by train with her mother and her younger brother when he dies. Her mother buries the boy in a cemetery by the tracks and Liesel picks up a book, \"The Gravediggers Handbook\", which was left on the grave of her brother and brings it with her. Liesel is delivered to a foster family in a small town and later she learns that her mother left her because she is a communist. Her stepmother, Rosa Hubermann, is a rude but caring woman and her stepfather, Hans Hubermann, is a simple kind-hearted man. Liesel befriends her next door neighbor, the boy Rudy Steiner, and they go together to the school. When Hans discovers that Liesel cannot read, he teaches her using her book and Liesel becomes an obsessed reader. During a Nazi speech where the locals are forced to burn books in a bonfire, Liesel recovers one book for her and the Mayor's wife Ilsa Hermann witnesses her action. Meanwhile Hans hides the Jewish Max Vandenburg, who is the son of a deceased friend that saved his life in the war, in the basement of his house and Liesel becomes his friend. One day, Rosa asks Liesel to deliver laundry to the Mayor and Ilsa invites Liesel to go to her library and tells that she can visit her to read whenever she wants. But in times of war there are many threats and the lives of Liesel, her family and friends will never be the same.",slug:"the-book-thief"}}},books:{data:[{id:3353,attributes:{title:"Real Hauntings — 3-Book Bundle",description:"This special three-book bundle collects three haunting books on the supernatural by Mark Leslie. In Spooky Sudbury and Haunted Hamilton he relays creepy tales from two of Canada’s cities. Lock the doors and turn on all the lights before you settle down with these stories, because once you begin to read about the supernatural elements that lurk within these seemingly normal towns in Southern Ontario, strange bumps in the night will take on new, more sinister meanings. In Tomes of Terror Leslie has compiled true stories of the supernatural in literary locales, complete with hair-raising first-person accounts. You may even recognize a spectre of your local library lurking in these true stories and photographs. If you have ever felt an indescribable presence hanging about a quiet bookshop, then you’ll enjoy these fascinating and haunting tales. Haunted Hamilton Spooky Sudbury Tomes of Terror",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=3AKhBAAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[c,g],firstBook:true,published:"2014-10-01",publisher:d,subtitle:"Spooky Sudbury\u002FHaunted Hamilton\u002FTomes of Terror"}},{id:3354,attributes:{title:"Real Hauntings 4-Book Bundle",description:"Experience a ghostly thrill with Mark Leslie’s four books on strange supernatural happenings. Creepy Capital True stories of ghostly encounters and creepy locales lurk throughout the Ottawa region. Come along with Canada’s paranormal raconteur extraordinaire, Mark Leslie, and discover the first-person accounts of ghostly happenings at landmarks throughout the historic city and surrounding towns. Haunted Hamilton From the Hermitage ruins to Dundurn Castle, from the Customs House to Stoney Creek Battlefield Park, the city of Hamilton, Ontario, is steeped in a rich history and culture. But beneath the surface of the Steel City there dwells a darker heart — from the shadows of yesteryear arise the unexplained, the bizarre, and the chilling. Spooky Sudbury From haunted mine shafts to inexplicable lights in the northern sky, there are strange things afoot in the peaceful northern municipality of Sudbury; eerie phenomenon that will amaze, give you pause, make you wonder, and have you looking twice at what might first appear to be innocent shadows. Tomes of Terror It’s been said that books have a life of their own, but there’s more than literature lurking in the cobwebbed recesses of dusty bookstores and libraries across Canada. Read about some of the most celebrated and eerie bookish haunts, and try to brush off that feeling of someone watching from just over your shoulder...",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=OomGCwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[c,g],firstBook:b,published:"2016-05-28",publisher:d,subtitle:"Creepy Capital \u002F Spooky Sudbury \u002F Haunted Hamilton \u002F Tomes of Terror"}},{id:3355,attributes:{title:"Tattered Cover Book Store",description:"For more than five decades, the Tattered Cover has been Colorado's favorite source for books. Beginning with just 950 square feet, it has grown into a multistore operation and important cultural institution, the special place where people go for all things literary. It has been a forum for ideas, with hundreds of writers visiting each year to sign books and greet readers. It has proven itself a bastion of democracy, championing the First Amendment and readers' rights to privacy. Join Denver historian and onetime Tattered Cover employee Mark A. Barnhouse as he celebrates the store's first fifty years and tells stories from the thousands of author events it has hosted over the decades.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=9RFSEAAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:["Mark A. Barnhouse"],firstBook:b,published:"2021-11-01",publisher:"Arcadia Publishing",subtitle:"A Storied History"}},{id:3356,attributes:{title:"Tomes of Terror",description:"A supernatural tour of bookstores and libraries around the world, focusing on the ghost stories from haunted locations. Throughout history, books have inspired, informed, entertained, and enriched us. They have also kept us up through the night, thrilled us, and lured into their endless depths. Tomes of Terror is a celebration and an eerie look at the siren call of literature and the unexplained and fascinating stories associated with bookish locations around the world. Mark Leslie’s latest paranormal page-turner is a compendium of true stories of the supernatural in literary locales, complete with hair-raising first-person accounts. You may even recognize a spectre of your local library lurking in these true stories and photographs. If you have ever felt an indescribable presence hanging about a quiet bookshop, then you’ll enjoy these fascinating and haunting tales.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=vQIiAwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[c],firstBook:b,published:"2014-09-10",publisher:d,subtitle:"Haunted Bookstores and Libraries"}},{id:3357,attributes:{title:"Public Policy Praxis",description:"Public administration and policy analysis education has long emphasized tidiness, stages, and rationality, but practitioners frequently must deal with a world where objectivity is buffeted by, repressed by, and sometimes defeated by, value conflict. Too often public administration education has failed individuals who must deal with the hustle and bustle and complexity of policymaking. Public Policy Praxis equips students to grapple with ambiguity and complexity. By emphasizing mixed methodologies and through the use of cases, students are encouraged to develop a workable and practical model of applied policy analysis. Throughout the book, Clemons and McBeth argue that pragmatism demands that analysts learn to think politically and to understand that public problems are socially constructed. As such, in addition to analytical models, the authors examine specific tools of policy analysis, such as stakeholder mapping, content analysis, group facilitation, narrative analysis, cost-benefit analysis, futuring, and survey analysis. Students are given the opportunity to try out these analytical models and tools in varied case settings (county, city, federal, urban, and rural) facing wide-ranging topics (economic development, expansion of human services in an urban area, building a health care clinic in a small town, an inner-city drug program, and the bison controversy in Yellowstone National Park) that capture the diversity of public policy and the intergovernmental nature of politics. With chapters written to the student and in a nearly conversational style, Public Policy Praxis is an ideal textbook for undergraduate and graduate courses in public policy analysis, community planning, leadership, social welfare policy, educational policy, family policy, and special seminars.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=b9nLDAAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:["Randy S. Clemons","Mark K McBeth"],firstBook:b,published:"2016-08-05",publisher:"Routledge",subtitle:"A Case Approach for Understanding Policy and Analysis"}}]}}},meta:{}}},prerenderedAt:1681309149303}}("movie",null,"Mark Leslie","Dundurn","series",1,"Jenny Jelen"))